import React from "react";

import classes from "./Footer.module.css";

const Footer = (props) => {
  return (
    <footer
      className={classes.footerWrap}
      style={{ top: `${props.footerTop}` }}
    >
      <p
        style={{
          fontFamily: "GmarketSansBold",
          fontSize: "24px",
          color: "#391f1f",
          textAlign: "center",
          paddingTop: "65px",
        }}
      >
        sam portfolio
      </p>
      <p
        style={{
          fontFamily: "GmarketSansMedium",
          fontSize: "16px",
          color: "#ccc",
          textAlign: "center",
          marginTop: "65px",
        }}
      >
        이 페이지는 개인 포트폴리오 목적으로 제작되었습니다.
      </p>
    </footer>
  );
};

export default Footer;
